import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const Dashboard = ({ user, setUser }) => {
  const [allUsers, setAllUsers] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    if (user.role === 'ADMIN') {
      axios.get('http://localhost:3000/api/admin/users')
        .then(res => setAllUsers(res.data))
        .catch(err => console.log(err));
    }
  }, [user.role]);

  const generateKey = async () => {
    const res = await axios.post('http://localhost:3000/api/generate-key', { userId: user.id });
    const updatedUser = { ...user, api_key: res.data.api_key };
    localStorage.setItem('user', JSON.stringify(updatedUser));
    setUser(updatedUser);
  };

  const logout = () => {
    localStorage.clear();
    setUser(null);
    navigate('/login');
  };

  return (
    <div style={{ padding: '40px', maxWidth: '900px', margin: 'auto', color: '#452829' }}>
      <div style={{ display: 'flex', justifyContent: 'space-between' }}>
        <h1>Dashboard {user.role}</h1>
        <button onClick={logout} style={{ cursor: 'pointer', background: 'none', border: 'none', textDecoration: 'underline' }}>Logout</button>
      </div>

      {user.role === 'ADMIN' ? (
        <div style={{ background: 'white', padding: '20px', borderRadius: '10px' }}>
          <h3>Monitoring User & Key</h3>
          <table border="1" cellPadding="10" style={{ width: '100%', borderCollapse: 'collapse', borderColor: '#E8D1C5' }}>
            <thead>
              <tr style={{ background: '#452829', color: 'white' }}>
                <th>Username</th><th>Email</th><th>Role</th><th>API Key</th>
              </tr>
            </thead>
            <tbody>
              {allUsers.map(u => (
                <tr key={u.id}>
                  <td>{u.username}</td><td>{u.email}</td><td>{u.role}</td><td><code>{u.api_key || '-'}</code></td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ) : (
        <div style={{ background: 'white', padding: '20px', borderRadius: '10px', textAlign: 'center' }}>
          <h3>API Key Anda</h3>
          <div style={{ background: '#F3E8DF', padding: '15px', margin: '15px 0', fontFamily: 'monospace' }}>
            {user.api_key || 'Belum ada Key'}
          </div>
          <button onClick={generateKey} style={{ background: '#452829', color: 'white', padding: '10px 20px', border: 'none', borderRadius: '5px' }}>
            Generate New Key
          </button>
          <br /><br />
          <button onClick={() => navigate('/recipes')} style={{ background: '#E8D1C5', padding: '10px', border: 'none', borderRadius: '5px' }}>
            Buka Explorer Resep â†’
          </button>
        </div>
      )}
    </div>
  );
};

export default Dashboard;
